import React from 'react';
import { useNavigate } from 'react-router-dom';

const Navbar = () => {
  const navigate = useNavigate();

  return (
    <div className="flex justify-between items-center px-6 py-4 bg-slate-800 text-white shadow-md rounded mb-6">
      <div className="text-xl font-bold cursor-pointer" onClick={() => navigate("/")}>
        ðŸš€ EM Service
      </div>
      <div className="flex space-x-6 text-lg">
        <button onClick={() => navigate("/")} className="hover:text-blue-400">Home</button>
        <button onClick={() => navigate("/profile")} className="hover:text-blue-400">Profile</button>
        <button onClick={() => navigate("/login")} className="hover:text-blue-400">Logout</button>
      </div>
    </div>
  );
};

export default Navbar;
